(85, 1, ' PHN THNG CC MC NP ', '<p> <strong>U &Atilde;I NP TIN C BIT!</strong> </p>\r\n\r\n<p> <strong>Mc 500k - H&ograve;a m&igrave;nh trong bin hng ngc!</strong>  Np  500k v&agrave; nhn ngay:</p>\r\n\r\n<ul>\r\n	<li> Bonus 50k hng ngc</li>\r\n	<li> 20 im quyn nng</li>\r\n	<li> 1 b 1 sao  ta s&aacute;ng trong h&agrave;nh tr&igrave;nh ca bn!</li>\r\n</ul>\r\n\r\n<p> <strong>Mc 1 triu - Vt qua nh cao c&ugrave;ng biu tng 5 sao!</strong>  Np  1 triu v&agrave; hng ngay:</p>\r\n\r\n<ul>\r\n	<li> Bonus 200k hng ngc</li>\r\n	<li> 100 im quyn nng</li>\r\n	<li> 5 b 1 sao  tr th&agrave;nh ng&ocirc;i sao s&aacute;ng nht!</li>\r\n</ul>\r\n\r\n<p> <strong>Mc 5 triu - nh cao ca sc mnh v&agrave; quyn lc!</strong>  Np  5 triu v&agrave; thu v:</p>\r\n\r\n<ul>\r\n	<li> Bonus 500k hng ngc</li>\r\n	<li> 500 im quyn nng</li>\r\n	<li> 20 b 1 sao  l&agrave;m ch mi th&aacute;ch thc!</li>\r\n</ul>\r\n\r\n<p> <strong>Kh&aacute;m ph&aacute; cm gi&aacute;c ca s ng cp!</strong> </p>\r\n\r\n<p>Phn qu&agrave; s c nhn ti Npc L&yacute; Tiu Nng ti o Kame khi tng np bn  c&aacute;c mc</p>\r\n', '2023-11-20 22:00:47', 3, 1161, 0),
(86, 1, '   Hng Dn Tn Th!   ', '<p><strong>CH&Agrave;O MNG T&Acirc;N TH N VI TH GII NGC RNG SAGA!</strong></p>\r\n\r\n<p> <strong>Nhng u &atilde;i c Bit D&agrave;nh Cho Bn:</strong></p>\r\n\r\n<p> <strong>Free V&agrave;ng?</strong> - C&oacute; ch! Tn hng h&agrave;nh tr&igrave;nh kh&ocirc;ng gii hn vi v&agrave;ng min ph&iacute; t server!</p>\r\n\r\n<p> <strong>Free Ngc?</strong> - Tt nhi&ecirc;n! Mi bc tin ca bn u c h tr bng nhng vi&ecirc;n ngc qu&yacute; gi&aacute;!</p>\r\n\r\n<p> <strong>Free S&eacute;t K&iacute;ch Hot?</strong> - &uacute;ng vy! c trang b nhng b trang phc mnh m m&agrave; kh&ocirc;ng tn mt xu!</p>\r\n\r\n<p> <strong>Kh&aacute;m Ph&aacute; Ht M&igrave;nh:</strong></p>\r\n\r\n<p> <strong>N&acirc;ng SKH Level 2:</strong></p>\r\n\r\n<ul>\r\n	<li>t c s&eacute;t k&iacute;ch hot level 2 vi 5 m&oacute;n Thn Linh v&agrave; 1 m&oacute;n k&iacute;ch hot level 1. Tng t l th&agrave;nh c&ocirc;ng l&ecirc;n 40% vi 1 vi&ecirc;n 1 sao!</li>\r\n</ul>\r\n\r\n<p> <strong>Thc n v&agrave; M&oacute;n Hy Dit:</strong></p>\r\n\r\n<ul>\r\n	<li>Tn dng 99 thc n v&agrave; 100 thi v&agrave;ng  i ly m&oacute;n hy dit, c&oacute; kh nng m ra 15%!</li>\r\n</ul>\r\n\r\n<p> <strong>G&acirc;y Sc vi Dame L&ecirc;n Toppo Hakai:</strong></p>\r\n\r\n<ul>\r\n	<li>eo 5 m&oacute;n hy dit  c&oacute; th g&acirc;y dame l&ecirc;n Toppo Hakai v&agrave; rinh v nhng phn thng gi&aacute; tr t hn!</li>\r\n</ul>\r\n\r\n<p> <strong>Ngc Rng  &acirc;u?</strong></p>\r\n\r\n<ul>\r\n	<li>Kh&aacute;m ph&aacute; c&aacute;c boss t 3 sao n 7 sao, c&ugrave;ng doanh tri v&agrave; bn  kho b&aacute;u  thu c ngc rng qu&yacute; gi&aacute;!</li>\r\n</ul>\r\n\r\n<p> <strong> T Zenno:</strong></p>\r\n\r\n<ul>\r\n	<li> t Zenno mnh m, gi&uacute;p tng 15% ch s khi hp th. N&acirc;ng cp vi c&aacute; ti&ecirc;n tri  tr n&ecirc;n v&ocirc; c&ugrave;ng mnh m!</li>\r\n</ul>\r\n\r\n<p> <strong>N&acirc;ng Cp H&igrave;nh Dng Cp 2:</strong></p>\r\n\r\n<ul>\r\n	<li>H&atilde;y chin u vi Black Goku v&agrave; Zamasu  kim mnh v, n&acirc;ng cp b&ocirc;ng tai cp 2 v&agrave; m ch s!</li>\r\n</ul>\r\n\r\n<p> <strong>V&agrave; C&ograve;n Rt Nhiu T&iacute;nh Nng Kh&aacute;c:</strong></p>\r\n\r\n<ul>\r\n	<li>Rng 11, Boss 22h, Boss 12h, Mabu 14, Bn  Kho B&aacute;u... c&ugrave;ng v&ocirc; s hot ng s c b sung vi nhng phn thng hp dn!</li>\r\n</ul>\r\n\r\n<p> <strong>H&atilde;y m Bo Bn Lu&ocirc;n Cp Nht Update!</strong></p>\r\n\r\n<ul>\r\n	<li>i ng admin s kh&ocirc;ng ngng l&agrave;m mi v&agrave; cp nht, m bo bn c&oacute; nhng tri nghim chi game l&acirc;u d&agrave;i v&agrave; hp dn nht!</li>\r\n</ul>\r\n\r\n<p><strong>Ch&uacute;c bn c&oacute; nhng gi&acirc;y ph&uacute;t vui chi thng hoa trong Th Gii Ngc Rng Saga!</strong> </p>\r\n', '2023-11-20 22:14:59', 3, 1601, 0),
(87, 1, 'Cch Kim Hng Ngc!', '<p><strong>Nhn Hng Ngc Ti Ngc Rng Saga:</strong></p>\r\n\r\n<p> <strong>B&ograve; Mng - Ni Hnh Ph&uacute;c Bt u:</strong></p>\r\n\r\n<ul>\r\n	<li>Tri nghim nim vui ca B&ograve; Mng vi 2 mc qu&agrave; min ph&iacute; v&agrave; nhim v hng ng&agrave;y.</li>\r\n	<li>Ho&agrave;n th&agrave;nh nhim v  nhn ngay nhng vi&ecirc;n hng ngc y gi&aacute; tr.</li>\r\n</ul>\r\n\r\n<p> <strong>im Danh Hng Ng&agrave;y - Du n Cuc Sng:</strong></p>\r\n\r\n<ul>\r\n	<li>Mi ng&agrave;y, h&atilde;y n v&agrave; im danh  m ch&igrave;m trong s phn kh&iacute;ch ca ngc rng.</li>\r\n	<li>K&iacute;ch hot th&agrave;nh vi&ecirc;n  nh&acirc;n &ocirc;i hnh ph&uacute;c vi x2 s lng hng ngc t im danh.</li>\r\n</ul>\r\n\r\n<p> <strong>Sn Boss - H&agrave;nh Tr&igrave;nh n T H&agrave;nh Tinh Fide:</strong></p>\r\n\r\n<ul>\r\n	<li>i mt vi boss tiu i Namek, nhng ngi gi&agrave;u c&oacute; n t h&agrave;nh tinh Fide.</li>\r\n	<li>Khi ch&uacute;ng b ti&ecirc;u dit, nhn ngay nhng vi&ecirc;n hng ngc m&agrave; ch&uacute;ng mang theo t h&agrave;nh tr&igrave;nh x&acirc;m chim tr&aacute;i t.</li>\r\n</ul>\r\n\r\n<p> <strong>Chinh Phc C&aacute;c Hot ng Hng Ng&agrave;y:</strong></p>\r\n\r\n<ul>\r\n	<li>Tham gia hot ng hng ng&agrave;y vi s hng khi v&agrave; nim am m&ecirc;.</li>\r\n	<li>Ho&agrave;n th&agrave;nh nhim v, i ly nim vui v&agrave; phn thng hng ngc.</li>\r\n</ul>\r\n\r\n<p> <strong>H&ograve;a M&igrave;nh Trong Th Gii Ngc Rng Saga:</strong></p>\r\n\r\n<ul>\r\n	<li>Kh&aacute;m ph&aacute; c&aacute;c t&iacute;nh nng c bit kh&aacute;c v&agrave; tn hng s phong ph&uacute; ca th gii ngc rng.</li>\r\n	<li>Mi hot ng u l&agrave; mt c hi  nhn th&ecirc;m hng ngc v&agrave; tri nghim v&ocirc; s nim vui!</li>\r\n</ul>\r\n\r\n<p> <strong>H&atilde;y m Bo Rng Bn Lu&ocirc;n  nh Cao Nim am M&ecirc;!</strong> </p>\r\n\r\n<p>V&agrave; cui c&ugrave;ng l&agrave; np c&aacute;c bn nh&eacute; =)))</p>\r\n', '2023-11-20 22:21:01', 3, 955, 0),
(88, 1, ' Tnh Nng H Tr Nhim V   ', '<p> <strong>Nhim V Th&aacute;ch Thc? Kh&ocirc;ng C&ograve;n L&agrave; Vn !</strong></p>\r\n\r\n<p> <strong>Th Nghim S Lng Ngi Chi:</strong></p>\r\n\r\n<ul>\r\n	<li>Sau bn test, ch&uacute;ng t&ocirc;i &atilde; lng nghe &yacute; kin ca cng ng v kh&oacute; khn trong vic ho&agrave;n th&agrave;nh nhim v do s lng ngi chi qu&aacute; &ocirc;ng.</li>\r\n</ul>\r\n\r\n<p> <strong>Ci Thin &aacute;ng K:</strong></p>\r\n\r\n<ul>\r\n	<li>&aacute;p ng nhanh ch&oacute;ng vi phn hi, ch&uacute;ng t&ocirc;i &atilde; tin h&agrave;nh iu chnh m  to ra mt tri nghim chi game mt m&agrave; hn.</li>\r\n</ul>\r\n\r\n<p> <strong>Ci Thin T&iacute;nh Nng:</strong></p>\r\n\r\n<ul>\r\n	<li>Tng s lng boss nhim v  to s a dng v&agrave; hng th&uacute;.</li>\r\n	<li>Gim thi gian ra boss, gi&uacute;p ngi chi nhanh ch&oacute;ng tham gia v&agrave;o cuc phi&ecirc;u lu.</li>\r\n</ul>\r\n\r\n<p> <strong>Khung Gi H Tr Nhim V:</strong></p>\r\n\r\n<ul>\r\n	<li>Thit lp khung gi h tr nhim v mi gi, vi c&aacute;c gi chn (2, 4, 6, 8, 10).</li>\r\n	<li>Ngi chi kh&ocirc;ng tham gia nhim v trong khong thi gian n&agrave;y s kh&ocirc;ng v&agrave;o c khu vc c&oacute; boss nhim v, to ra c hi c&ocirc;ng bng cho tt c.</li>\r\n</ul>\r\n\r\n<p> <strong>S Thay i Mang Li Tri Nghim D D&agrave;ng:</strong></p>\r\n\r\n<ul>\r\n	<li>Nhng ci tin n&agrave;y ha hn gi&uacute;p cng ng tri nghim d d&agrave;ng hn, mc d&ugrave; vn gi nguy&ecirc;n mc  th&aacute;ch thc do s &ocirc;ng &uacute;c ca cng ng.</li>\r\n</ul>\r\n\r\n<p> <strong>Chinh Phc Nhim V C&ugrave;ng Ngi Chi Kh&aacute;c:</strong></p>\r\n\r\n<ul>\r\n	<li>Vi s tng cng v&agrave; t&iacute;nh cnh tranh, tri nghim chi game s tr n&ecirc;n hp dn hn bao gi ht!</li>\r\n</ul>\r\n\r\n<p><strong>Tham Gia Ngc Rng Saga Ngay H&ocirc;m Nay v&agrave; H&ograve;a M&igrave;nh Trong H&agrave;nh Tr&igrave;nh y Hng Khi!</strong> </p>\r\n', '2023-11-20 22:42:07', 3, 1023, 0),
(89, 1, 'Cp Nht 22/11 Cho Ngc Rng Saga', '<p><strong>Cp Nht Cho Ngc Rng Saga:</strong></p>\r\n\r\n<p> <strong>Sa Gi Bo Tr&igrave;:</strong></p>\r\n\r\n<ul>\r\n	<li>Tn hng tri nghim mt m&agrave; hn vi gi bo tr&igrave; t ng v&agrave;o 5h s&aacute;ng v&agrave; 5h chiu.</li>\r\n	<li>m bo ngi chi c&oacute;  thi gian th gi&atilde;n v&agrave; ch &oacute;n nhng n&acirc;ng cp mi!</li>\r\n</ul>\r\n\r\n<p> <strong>B Xung Hng Ngc v&agrave;o Rng 11:</strong></p>\r\n\r\n<ul>\r\n	<li>M rng c hi ph&aacute;t hin vi s th&ecirc;m v&agrave;o hng ngc trong Rng 11.</li>\r\n	<li>Ch&uacute;ng ang ch i  tr th&agrave;nh ca bn trong nhng ng&oacute;c ng&aacute;ch b&iacute; mt ca tr&ograve; chi!</li>\r\n</ul>\r\n\r\n<p> <strong>Boss Tiu i S&aacute;t Th Namek:</strong></p>\r\n\r\n<ul>\r\n	<li>Ch&iacute;nh thc xut hin boss tiu i S&aacute;t Th Namek tr&ecirc;n u trng.</li>\r\n	<li>H&atilde;y chin u vi h  gi&agrave;nh c nhng vi&ecirc;n hng ngc v&agrave; thi v&agrave;ng qu&yacute; gi&aacute; t h&agrave;nh tr&igrave;nh x&acirc;m chim tr&aacute;i t!</li>\r\n</ul>\r\n\r\n<p> <strong>Boss Toppo - Th&aacute;ch Thc Ti Cao:</strong></p>\r\n\r\n<ul>\r\n	<li>i mt vi s xut hin ca boss Toppo, ngi bo v v&ocirc; c&ugrave;ng mnh m.</li>\r\n	<li>G&acirc;y s&aacute;t thng v&agrave;o Toppo bng c&aacute;ch mc  hy dit  nhn nhng  thi&ecirc;n s ch s ngu nhi&ecirc;n t hn.</li>\r\n</ul>\r\n\r\n<p> <strong>Tiu i YD Ri B&iacute; K&iacute;p:</strong></p>\r\n\r\n<ul>\r\n	<li>Nhim v truy ui hc thut tng cao vi b&iacute; k&iacute;p t Tiu i YD.</li>\r\n	<li>H&atilde;y thu thp v&agrave; kh&aacute;m ph&aacute; nhng b&iacute; mt n sau nhng trang s&aacute;ch qu&yacute; gi&aacute; n&agrave;y.</li>\r\n</ul>\r\n\r\n<p><strong>Thng Thc H&agrave;nh Tr&igrave;nh Mi v&agrave; Nhng Kh&aacute;m Ph&aacute; B&iacute; n Ti Ngc Rng Saga!</strong> </p>\r\n', '2023-11-22 14:40:52', 3, 551, 0),
(90, 1, ' PHN THNG CC MC NP ', '<p> <strong>u &atilde;i Np Tin Hp Dn Ti Ngc Rng Saga!</strong></p>\r\n\r\n<p> <strong>Mc Np 20k&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>Np 20k  nhn ngay 1 th i skill 2,3,4,5  cho mi loi x1</li>\r\n</ul>\r\n\r\n<p> <strong>Mc Np 50k&nbsp;</strong></p>\r\n\r\n<ul>\r\n	<li>t mc&nbsp;50k  s hu ngay mt gy Thi&ecirc;n S&nbsp;</li>\r\n	<li>V kh&iacute; mnh m gi&uacute;p bn ta s&aacute;ng trong mi trn u, c&oacute; th g&acirc;y dame l&ecirc;n Whis v&agrave; Bill</li>\r\n</ul>\r\n\r\n<p> <strong>Mc Np 100k -  Zeno v&agrave; Hp Ci Trang Zamasu:</strong></p>\r\n\r\n<ul>\r\n	<li>Np 100k  nhn ngay:\r\n	<ul>\r\n		<li>1  Zeno - ngi ng h&agrave;nh mnh m.</li>\r\n		<li>5 hp ci trang Zamasu</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p> <strong>Mc Np 2tr - i Tic Hng Ngc:</strong></p>\r\n\r\n<ul>\r\n	<li>Np 2tr v&agrave; &oacute;n nhn mt kho b&aacute;u qu&yacute; gi&aacute;:\r\n	<ul>\r\n		<li>300k hng ngc - ngun lc quan trng cho sc mnh ca bn.</li>\r\n		<li>10 b 1 sao -  thng tin ng cp nhanh ch&oacute;ng.</li>\r\n		<li>200 im quyn nng</li>\r\n		<li>Phn thng s c nhn ti 1 tab mi ti&nbsp;L&yacute; Tiu Nng, nhng ai &atilde; nhn mc np c s kh&ocirc;ng b nh hng</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n', '2023-11-23 21:31:02', 3, 1282, 1),
